import "./App.css";

const LoggedInUser = () => {
  return (
    <p>
      hello <span className="username"></span>
    </p>
  );
};

const Header = () => {
  return(
    <header>
      <h2>Blog App</h2>
      <LoggedInUser />
    </header>
  );
};

function App() {
  return (
    <div>
      <Header />
    </div>
  );
}

export default App;
